import { useState } from 'react';
import { Link } from 'react-router-dom';
import {ShoppingOutlined, MedicineBoxOutlined ,PartitionOutlined } from '@ant-design/icons';
import Makeups from './Makeups';

const Nav = () => {
  const [isVisible, setVisible] = useState(false);
  const handleDisplay=()=>{
    setVisible(!isVisible)
  }

  return (
    <div>
     <Link to="/makeups"><ShoppingOutlined style={{fontSize: '30px', color: 'orange' }} onClick={handleDisplay}/> 化妆品{isVisible?<Makeups/>:""}</Link>
    <Link to="/medicine"><MedicineBoxOutlined style={{ fontSize: '30px', color: 'orange' }}/>  药物</Link>
    <Link to="/others"><PartitionOutlined style={{ fontSize: '30px', color: 'orange' }}/> 其他</Link> 
    </div>
  );
}; 
export default Nav;
